*
 * This UniversalEmbedding provide methods for transform sentences into 
 * its single vector representation 
 * based on [use](https://github.com/tensorflow/tfjs-models/tree/master/universal-sentence-encoder)
 * 
 * @class UniversalEmbedding
 * @extends {Tensor}
 * @example
 * import { universalEmbedding, Log } from 'causal-net.representation';
 * import { termLogger } from 'causal-net.log';
 * (async ()=>{
 *     // termLogger.groupBegin();
 *     await universalEmbedding.connect();
 *     // termLogger.groupEnd();
 *     let sentVec = await universalEmbedding.sentenceEncode([ 'this is test' ])
 *     sentVec.print();
 * })();

